import React from 'react';

const sidebar = ({data}) =>{
  return (
    <div  className="column side">
      {
        data.map(item => (
          <div >
              <a href="#">
                <span style={{marginRight:"20px"}}><img style={{width:"20px"}} src = {item.image} alt=""/></span>
                <span>{item.name}</span>
              </a><br/><br/>
          </div>
          ))
      }

      <div>
        <button type="button">Tweet</button>
      </div>
    </div>
    )
}

export default sidebar;
